import Navbar from "../components/Navbar";
import { Link } from "react-router-dom";
import logo from "../image/logo.png";
// import "./AboutUs.css";

function AboutUs() {
  return (
    <div className="AboutUs h-screen">

      <Navbar/>
      <h1>Qui sommes-nous?</h1>
      <h1>CIPA JESSOUGNON SA est une société
spécialisée dans les domaines de l’Entretien et
Nettoyage , désinfection et dératisation des
espaces publics et privés. Elle est dotée d’un
personnel qualifié, rompu à la tâche, avec des
équipements de dernière génération, une
solide expérience professionnelle de près de
20 ans et participe chaque année aux salons
d’hygiène en Europe. L’ensemble de nos
prestations respectent les principes de
nettoyage dans les Etablissement de grandes
affluences et de luxe. Elles allient la protection
à l’usage des techniques douces et procèdent
à la réalisation de tests en cas de doute, du
vertical à l’horizontal, du propre vers le sale à
reculons.</h1>

    </div>
  );
}

export default AboutUs;
